const title = document.querySelector('.title')
const text = document.querySelector('.text')
const mask = document.querySelector('.mask')
const game = document.querySelector('.gameWrapper')
const end = document.querySelector('.end')
const endButton = document.querySelector('.end_button')

const letter = document.querySelector('.letter_basket')
const checks = document.querySelector('.checks_basket')
const mails = document.querySelector('.mail_basket')
const spam = document.querySelector('.spam_basket')


const fillBaskets = [
  'data:image/png;base64,',
  'data:image/png;base64,',
  'data:image/png;base64,',
  'data:image/png;base64,'
]

let letterBasket = fillBaskets[0]
let checkBasket = fillBaskets[1]
let spamBasket = fillBaskets[2]
let mailsBasket = fillBaskets[3]


let touchMove = false
let gameisStarting = false
let animationIsEnd = false
let letterIsMoving = false
let firstIsletter = false
let rightLetterCount = 0

function smoothStart(elem) {
  elem.classList.add('smooth-start')
}
function smoothEnd(elem) {
  elem.classList.add('smooth-end')
}

// touch events

document.addEventListener('touchmove', () => {
    touchMove = true
})
document.addEventListener('touchstart', e => {
  if (e.target.classList.contains('letter')) {
    e.preventDefault()
    e.target.style.transform = `scale(1.1)`
  }
    startX = e.touches[0].clientX;
    startY = e.touches[0].clientY;  
    if (animationIsEnd) {
        new Game().animateArrows(), smoothEnd(text)
        animationIsEnd = false
    }
});
document.addEventListener('touchend', e => {
    if (touchMove) {
        document.querySelectorAll('.letter').forEach(item => {item.style.transform = `scale(1)`})
        let end = e.changedTouches[0];
        if (!letterIsMoving) {
          new Letter().calculate(startX, startY, end.pageX, end.pageY)
        }
        touchMove = false      
    }
});

// mouse events

document.addEventListener('mousedown', e => {
    e.preventDefault()
    if (e.target.classList.contains('letter') && !letterIsMoving) {
      e.target.style.transform = `scale(1.1)`
    } 
    startX = e.pageX;
    startY = e.pageY;  
    
    if (animationIsEnd) {
        new Game().animateArrows(), smoothEnd(text)
        animationIsEnd = false
    }
});
document.addEventListener('mouseup', e => {    
    e.preventDefault()
    document.querySelectorAll('.letter').forEach(item => {item.style.transform = `scale(1)`})
    x = e.pageX
    if (!letterIsMoving) {
      new Letter().calculate(startX, startY, e.pageX, e.pageY)
    }
});

// letter moving

class Letter {
    constructor() {
        this.count = 0
    }
    calculate(startX, startY, endX, endY) {
        if (startX !== endX && gameisStarting) {
            const distY = Math.abs(startY - endY);
            const distX = Math.abs(startX - endX);
        
            let angle = Math.atan2(distY, distX);
            angle = angle * (180 / Math.PI);
            if (angle < 0) {
            angle = angle + 360;
            }
            endX > startX ? this.move(90-angle) : this.move(-(90-angle))
        }
    }
    animate(elem, angle) {
        letterIsMoving = true
        elem.animate([
          { transform: `rotate(${angle}deg) translateY(0px)` },
          { transform: `rotate(${angle}deg) translateY(-150vw)` }
        ], {
          duration: 4000,
        })
        this.checkBasket(elem)
    }
    move(angle) {
      document.querySelectorAll('.letter').forEach((item, index) => {
        if (index === this.count) {    
            this.animate(item, angle)
      }
      if (index === this.count+1) {
        item.style.transform = `translateY(-2vw)`
      }
      })
    }
    checkBasket(item) {
        let letterWidth = item.clientWidth
        let timer = setInterval(() => {
            let itemLeft = item.getBoundingClientRect().x
            let itemTop = item.getBoundingClientRect().y
            let itemRight = item.getBoundingClientRect().right
            let elem1 = document.elementFromPoint(itemLeft, itemTop)
            let elem2 = document.elementFromPoint(itemRight, itemTop)
            let elem3 = document.elementFromPoint((itemLeft + (letterWidth/2)), itemTop)
        
              if (!elem1 || !elem2 || !elem3) {
                setTimeout(() => {
                    new Game().loseMask()
                    new Game().end()
                }, 500)
              }        
              else if (elem1.classList.contains('basket') || elem2.classList.contains('basket') || elem3.classList.contains('basket')) {
                if (item.getAttribute('data-type') === elem1.getAttribute('data-type') || item.getAttribute('data-type') === elem2.getAttribute('data-type') || item.getAttribute('data-type') === elem3.getAttribute('data-type')) {
                  rightLetterCount++
                  smoothEnd(item)
                  setTimeout(() => {item.remove()}, 200)
                  clearTimeout(timer)
                  new Game().winMask()
                  this.fillBasket(item.getAttribute('data-type'))
                  letterIsMoving = false
                  rightLetterCount === 4 ? new Game().end() : null
                }
              else {
                new Game().loseMask()
                item.style.opacity = 0
                clearTimeout(timer)
                setTimeout(() => {
                    new Game().end()
                }, 1500)
              }
            }
        }, 16)
    }
    fillBasket(data) {
      data === 'letter' ? letter.setAttribute('src', `${letterBasket}`) :
      data === 'checks' ? checks.setAttribute('src', checkBasket) :
      data === 'spam' ? spam.setAttribute('src', spamBasket) :
      mails.setAttribute('src', mailsBasket)
    }
}

// game load

class Game {
    start() {
        title.classList.add('scaleTitle')
        setTimeout(() => {title.classList.remove('scaleTitle')}, 1500)
        this.animateLetters()        
        setTimeout(() => {smoothEnd(title)}, 1000)
        setTimeout(() => {smoothStart(text), animationIsEnd = true, gameisStarting = true}, 1400)
    }
    animateLetters() {
        document.querySelectorAll('.letter').forEach((item, index) => {
            index === 3 ? setTimeout(() => {item.classList.add('moveLetters')}) :
            index === 2 ? setTimeout(() => {item.classList.add('moveLetters')}, 300) :
            index === 1 ? setTimeout(() => {item.classList.add('moveLetters')}, 600) : null
            setTimeout(() => {item.classList.add('moveLetters')}, 900)
        })
        setTimeout(() => {
          document.querySelectorAll('.letter').forEach((item) => {
            item.classList.remove('moveLetters')
          })
        }, 1300)

    }
    animateArrows() {
        document.querySelectorAll('.arrow').forEach((item, index) => {
            index === 0 ? item.style.opacity = 1 :
            index === 1 ? setTimeout(() => {item.style.opacity = 1}, 200) :
            index === 2 ? setTimeout(() => {item.style.opacity = 1}, 400) : null
          })
          document.querySelectorAll('.arrow').forEach((item, index) => {
            index === 0 ? setTimeout(() => {item.style.opacity = 0}, 500) :
            index === 1 ? setTimeout(() => {item.style.opacity = 0}, 700) :
            index === 2 ? setTimeout(() => {item.style.opacity = 0}, 900) : null
          })
    }
    winMask() {
        mask.classList.remove('none')
        mask.classList.add('win')
        setTimeout(() => {mask.classList.add('none')}, 500)
        setTimeout(() => {mask.classList.remove('win')}, 1500)
    }
    loseMask() {
        mask.classList.remove('none')
        mask.classList.add('lose')
        setTimeout(() => {mask.classList.add('none')}, 500)
        setTimeout(() => {mask.classList.remove('lose')}, 1500)
    }
    end() {
        smoothEnd(game)
        end.classList.remove('none')
        end.classList.add('moveEnd')
        setTimeout(() => {endButton.style.opacity = 1}, 500)
        setTimeout(() => {endButton.classList.add('scaleButton')}, 500)
    }
}
new Game().start()
